import { Button } from "react-bootstrap";

export default function Board2Button() {
  return (
    <>
      <div
        style={{
          width: "70%",
          margin: "0 auto",
        }}
      ></div>
      <div style={{ width: "30%", textAlign: "right", margin: "0 auto" }}>
        <Button variant="warning">Warning</Button>{" "}
        <Button variant="success">Success</Button>{" "}
      </div>
    </>
  );
}
